part of 'id_cards_cubit.dart';

 class IdCardsState extends Equatable {
  const IdCardsState(
    {
      required this.name,
      required this.expirationDate,
    }
  );

  String name;
  DateTime expirationDate;

  @override
  List<Object> get props => [
    name,
    expirationDate,
  ];
}

final class IdCardsInitial extends IdCardsState {}
